import{_ as o,o as r,c as t,a as e,b as n,w as s,d as a,e as z,r as c}from"./app.28237d60.js";const d={},p=e("h1",{id:"rozwiazywanie-problemow",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#rozwiazywanie-problemow","aria-hidden":"true"},"#"),a(" Rozwi\u0105zywanie problem\xF3w")],-1),w={class:"custom-container tip"},u=e("i",{class:"fas fa-info"},null,-1),l=a("Prosz\u0119 r\xF3wnierz korzysta\u0107 z strony z "),y=a("cz\u0119sto zadawanymi pytaniami(FAQ)"),k=z('<p>Je\u017Celi napotkasz problem, prosz\u0119 najpierw sprwad\u017A t\u0105 stron\u0119. W przypadku kiedy nie mo\u017Cesz znale\u015B\u0107 twojego problemu tutaj, albo kroki podane tutaj nie rozwi\u0105zuj\u0105 problemu, prosz\u0119 skontakuj si\u0119 z administratorem twojego serwera lub <a href="./report-issue">Zg\u0142o\u015B b\u0142\u0105d</a>.</p><h2 id="klient-sie-nie-uruchamia" tabindex="-1"><a class="header-anchor" href="#klient-sie-nie-uruchamia" aria-hidden="true">#</a> Klient si\u0119 nie uruchamia</h2><p>W wi\u0119kszo\u015Bci przypadk\xF3w jest to spowodowane przez przestarza\u0142\u0105 przegl\u0105dark\u0119 lub system operacyjny. Prosz\u0119 spr\xF3buj zaktualizowa\u0107 tw\xF3j system lub przegl\u0105dark\u0119 do najnowszej wersji i wtedy spr\xF3buj ponownie.</p><p>Mimo i\u017C to nie dzieje si\u0119 zbyt cz\u0119sto, je\u017Celi tw\xF3j klient nadal si\u0119 nie uruchamia, jest mo\u017Cliwe \u017Ce cache/bufor mo\u017Ce by\u0107 problemem. W tym przypadku prosz\u0119 wyczy\u015B\u0107 pami\u0119\u0107 cache i spr\xF3buj ponownie.</p><h2 id="strony-nie-moga-sie-za\u0142adowac" tabindex="-1"><a class="header-anchor" href="#strony-nie-moga-sie-za\u0142adowac" aria-hidden="true">#</a> Strony nie mog\u0105 si\u0119 za\u0142adowa\u0107</h2><p>Je\u017Celi tw\xF3j klient si\u0119 uruchamia, ale widzisz b\u0142\u0105d przy za\u0142adowaniu strony, prosz\u0119 sprawd\u017A twoje po\u0142\u0105czenie sieciowe w poszukiwaniu b\u0142\u0119d\xF3w. Na dodatek sprawd\u017A czy serwer z kt\xF3rym chcesz si\u0119 po\u0142\u0105czy\u0107 nie jest wy\u0142\u0105czony.</p><p>Mimo i\u017C to nie dzieje si\u0119 zbyt cz\u0119sto, przypadki gdzie pami\u0119\u0107 podr\u0119czna/cache/bufor mog\u0105 by\u0107 problemem. W tym przypadku wyczy\u015B\u0107 j\u0105 i spr\xF3buj ponownie.</p><p>Wszystkie inne problemy najpewniej s\u0105 zwi\u0105zane z serwerem z kt\xF3rego chcesz skorzysta\u0107 wi\u0119c skontaktuj si\u0119 z jego administratorem.</p><h2 id="klient-jest-wolny" tabindex="-1"><a class="header-anchor" href="#klient-jest-wolny" aria-hidden="true">#</a> Klient jest wolny</h2><p>Prosz\u0119 wypr\xF3buj kt\xF3r\u0105\u015B z opcji:</p><ul><li>Aktywuj &quot;Redukuj animacje interfejsu&quot; w ustawieniach klienta</li><li>Wy\u0142\u0105cz &quot;U\u017Cyj efektu rozmycja dla modu\u0142\xF3w&quot; w ustawieniach klienta</li><li>W\u0142\u0105cz akceleracj\u0119 sprz\u0119tow\u0105 w ustawieniach przegl\u0105darki</li><li>Ulepsz specyfikacj\u0119 twojego urz\u0105dzenia (heh)</li></ul><h2 id="czesci-interfejsu-dzia\u0142aja-dziwnie-na-przyk\u0142ad-t\u0142o-jest-przezroczyste" tabindex="-1"><a class="header-anchor" href="#czesci-interfejsu-dzia\u0142aja-dziwnie-na-przyk\u0142ad-t\u0142o-jest-przezroczyste" aria-hidden="true">#</a> Cz\u0119\u015Bci interfejsu dzia\u0142aj\u0105 dziwnie (Na przyk\u0142ad: t\u0142o jest przezroczyste)</h2><p>Zepsuty interfejs mo\u017Ce by\u0107 spowodowany przez system bufor\xF3w motyw\xF3w kiedy interfejs jest zmieniony jako cz\u0119\u015B\u0107 aktualizacji. Korzystajnie z opcji &quot;Wyczy\u015B\u0107 bufor&quot; w ustawieniach powinno rozwi\u0105za\u0107 problem.</p><div class="custom-container warning"><i class="fas fa-exclamation"></i><p>Wyczy\u015B\u0107 bufor/cache &quot;Klienta&quot;. Nie czy\u015B\u0107 buforu/cache &quot;Przegl\u0105darki&quot;.</p></div><h2 id="migajace-swiat\u0142o-powiadomien-lub-antena-nie-znika" tabindex="-1"><a class="header-anchor" href="#migajace-swiat\u0142o-powiadomien-lub-antena-nie-znika" aria-hidden="true">#</a> Migaj\u0105ce \u015Bwiat\u0142o powiadomie\u0144 lub antena nie znika</h2><p>Migaj\u0105ce \u015Bwiat\u0142o pokazuje nieprzeczytane materia\u0142y. W przypadkach, gdy ta lampka nie znika, zazwyczaj jest to nieprzeczytana zawarto\u015B\u0107, kt\xF3ra zosta\u0142a wyparta przez now\u0105, przychodz\u0105c\u0105 zawarto\u015B\u0107. Je\u015Bli uwa\u017Casz, \u017Ce przeczyta\u0142e\u015B ca\u0142\u0105 zawarto\u015B\u0107, ale kontrolka nadal nie znika (prawdopodobnie jest to b\u0142\u0105d), mo\u017Cesz si\u0142\u0105 zaznaczy\u0107 ca\u0142\u0105 zawarto\u015B\u0107 jako przeczytan\u0105 w ustawieniach u\u017Cytkownika.</p><h2 id="przycisk-do-renotowania-jest-zablokowany" tabindex="-1"><a class="header-anchor" href="#przycisk-do-renotowania-jest-zablokowany" aria-hidden="true">#</a> Przycisk do renotowania jest zablokowany</h2><p>Post\xF3w udost\u0119pnionych tylko &quot;dla obserwuj\u0105cych&quot; nie mo\u017Cna renotowa\u0107</p><h2 id="okreslone-czesci-przegladarkowego-interfejsu-misskey-are-nie-sa-wyswietlane" tabindex="-1"><a class="header-anchor" href="#okreslone-czesci-przegladarkowego-interfejsu-misskey-are-nie-sa-wyswietlane" aria-hidden="true">#</a> Okre\u015Blone cz\u0119\u015Bci Przegl\u0105darkowego Interfejsu Misskey are nie s\u0105 wy\u015Bwietlane</h2><p>Problemy tego typu mog\u0105 si\u0119 pojawi\u0107 je\u017Celi korzystasz z narz\u0119dzi do blokowania reklam(np. Adblock). Dla poprawnego dzia\u0142ania Misskey spr\xF3buj je wy\u0142\u0105czy\u0107.</p><h2 id="niektore-czesci-interfejsu-przegladarkowego-misskey-nie-sa-przet\u0142umaczone" tabindex="-1"><a class="header-anchor" href="#niektore-czesci-interfejsu-przegladarkowego-misskey-nie-sa-przet\u0142umaczone" aria-hidden="true">#</a> Niekt\xF3re cz\u0119\u015Bci Interfejsu Przegl\u0105darkowego Misskey nie s\u0105 przet\u0142umaczone</h2><p>W wi\u0119kszo\u015Bci przypadk\xF3w jest to pow\xF3d tego \u017Ce t\u0142umaczenie nie jest jeszcze wykonane zamiast bycia b\u0142\u0119dem. Prosz\u0119 poczeka\u0107 dop\xF3ki t\u0142umaczenie danej cz\u0119sci zostanie uko\u0144czone. Mo\u017Cesz r\xF3wnierz samemu <a href="./misskey">przy\u0142\u0105czy\u0107 si\u0119 do t\u0142umaczenia Interfejsu Misskey</a>.</p>',22);function h(j,m){const i=c("RouterLink");return r(),t("div",null,[p,e("div",w,[u,e("p",null,[l,n(i,{to:"/pl/docs/faq.html"},{default:s(()=>[y]),_:1})])]),k])}var f=o(d,[["render",h],["__file","troubleshooting.html.vue"]]);export{f as default};
